      ?person dbo:birthDate "1850-06-24"^^xsd:date .
    }
  } BIND(?person AS ?commander) .

  ?commander dbo:militaryCommand [
    ?conflict2 .
    BIND(?conflict2 AS ?personMilitaryConflict)
  ] .

  # A Field Battery, Royal Australian Artillery and its war
  dbr:A_Field_Battery,_Royal_Australian_Artillery dbo:participatedInWar ?war .
  BIND(?war AS ?batteryWar)
}
```

