WHERE {
  # Ministry of the Army (Spain) and its leader
  dbr:Ministry_of_the_Army_(Spain) dbo:head ?leader .

  # Military force associated with an event that is both a military conflict and societal event
  ?militaryForce dbo:commander ?asensio .
  ?event dbo:militaryConflict true ;
         dbo:societalEvent true ;
         dbo:participatedInMilitaryForce ?militaryForce .

  # Carlos Asensio Cabanillas as commander in the force
  dbr:Carlos_Asensio_Cabanillas dbo:commanderOf ?militaryForce .

  # President and politician from Restoration (Spain)
  ?president dbo:nationality dbr:Restoration_(Spain) ;
             a dbo:President ;
             a dbo:Politician .

  # Linking the president to the event
  ?event dbo:participatedInMilitaryForce ?militaryForce ;
         dbo:relatedTo ?president .
}
```

