PREFIX dbr: <http://dbpedia.org/resource/>

SELECT ?person WHERE {
  # Find Deanne Bray's birth year
  VALUES (?deanneBrayBirthYear) { 
    SELECT ?birthYear WHERE {
      dbr:Deanne_Bray dbo:birthday ?birthDate .
      BIND(YEAR(?birthDate) AS ?birthYear)
    }
  }

  # Find the actor of "Being Mrs Elliot"
  ?actor dbo:title ?title .
  FILTER(CONTAINS(LCASE(str(?title)), "being mrs elliot"))

  # Ensure this person was born in Deanne Bray's birth year
  ?actor dbo:birthday ?birthDate .
  BIND(YEAR(?birthDate) AS ?actorBirthYear)
  FILTER(?actorBirthYear = ?deanneBrayBirthYear)

  # Ensure the actor is also known as Ayo Makun
  VALUES (?ayoMakun) { dbr:Ayo_Makun }
  FILTER(?actor = ?ayoMakun)

  BIND(?actor AS ?person)
}
```

