SELECT ?office ?role WHERE {
  # Find information about Carlos Franco Iribarnegaray
  ?person a dbo:Person ;
          foaf:name "Carlos Franco Iribarnegaray"@en ;
          dbo:occupation ?occupation .

  # Identify his role as a leader in an office (government agency or organization)
  OPTIONAL {
    ?office dbo:leader ?person .
    ?office a ?type .
