```sparql
PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbr: <http://dbpedia.org/resource/>
PREFIX dbp: <http://dbpedia.org/property/>

SELECT ?office WHERE {
  ?person a dbo:Politician ;
          foaf:name "Mehmet Naci Bostancı"@en ;
          dbo:nationality dbr:Turkey .

  OPTIONAL { ?person dbo:birthName "Mehmet Naci Bostancı"@en . }

  ?person dbo:office ?office .

  FILTER EXISTS {
    ?office dbo:positionTitle "Mayor"@en .
  }

  OPTIONAL {
    ?person dbo:party dbr:Nation_Alliance_(Turkey) .
  }
}
```

