```sparql
PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbp: <http://dbpedia.org/property/>

SELECT ?spouse WHERE {
  # Princess Caroline-Mathilde of Denmark and her spouse
  ?carolineMathilde a dbo:Person ;
                   foaf:name "Princess Caroline-Mathilde of Denmark"@en ;
                   dbp:spouse ?spouse .

  OPTIONAL {
    # Frederick IX's father
    ?frederickIX a dbo:Person ;
                 foaf:name "Frederick IX of Denmark"@en ;
                 dbp:father ?father .

    # Children of Frederick IX's father
    ?child1 a dbo:Person ;
            dbp:parent ?father .

    # Alexandrine of Mecklenburg-Schwerin and her children
    ?alexandrine a dbo:Person ;
                 foaf:name "Alexandrine of Mecklenburg-Schwerin"@en ;
                 dbp:child ?child2 .

    FILTER(?spouse = ?child1 || ?spouse = ?child2)
  }
}
```

