```sparql
PREFIX dbo: <http://dbpedia.org/ontology/>
PREFIX dbp: <http://dbpedia.org/property/>

SELECT DISTINCT ?spouse WHERE {
  # Knud, Hereditary Prince of Denmark
  ?knud dbo:child ?child1 .
  FILTER(STRSTARTS(LCASE(?knud), "knud, hereditary prince of denmark"))

  # Christian X of Denmark
  ?christianX dbo:child ?child2 .
  FILTER(STRSTARTS(LCASE(?christianX), "christian x of denmark"))

  # Find common child
  VALUES ?commonChild { ?child1 ?child2 }

  # Determine which parent is royalty and find their spouse
  {
    ?knud dbo:spouse ?spouse .
    FILTER(STRSTARTS(LCASE(?knud), "knud, hereditary prince of denmark"))
  } UNION {
    ?christianX dbo:spouse ?spouse .
    FILTER(STRSTARTS(LCASE(?christianX), "christian x of denmark"))
  }
}
```

